import{_ as t,o as e,c as a,R as r}from"./chunks/framework.320df067.js";const m=JSON.parse('{"title":"lua-languages","description":"","frontmatter":{"aside":false},"headers":[],"relativePath":"translation/scripting/lua-languages.md","filePath":"translation/scripting/lua-languages.md","lastUpdated":1686923289000}'),l={name:"translation/scripting/lua-languages.md"},i=r('<h1 id="lua-languages" tabindex="-1">lua-languages <a class="header-anchor" href="#lua-languages" aria-label="Permalink to &quot;lua-languages&quot;">​</a></h1><h2 id="luaにコンパイル可能な言語" tabindex="-1">Luaにコンパイル可能な言語 <a class="header-anchor" href="#luaにコンパイル可能な言語" aria-label="Permalink to &quot;Luaにコンパイル可能な言語&quot;">​</a></h2><p>Luaは有名ですが、騙されるほどシンプルで、多くの異なるプログラミングパラダイムを可能にします。Javascriptのように、より専門的な構文を追加することで輝かせることが可能です。このリストは、私がML/F#のような言語を探して見つけた言語を記録するために始めました。</p><p>注：未整備の言語には(*)を、アーカイブ言語には(^)を付けています。</p><p>プルリクエストを歓迎します！</p><h3 id="バイトコードにコンパイルする" tabindex="-1">バイトコードにコンパイルする <a class="header-anchor" href="#バイトコードにコンパイルする" aria-label="Permalink to &quot;バイトコードにコンパイルする&quot;">​</a></h3><p><a href="https://github.com/rochus-keller" target="_blank" rel="noreferrer">Rochus Keller</a>が始めたOberonからLuaJITへのバイトコードコンパイラの開発は、エコシステムを活用するエレガントな方法として興味深いものです：</p><ul><li><a href="https://github.com/rochus-keller/Oberon/" target="_blank" rel="noreferrer">https://github.com/rochus-keller/Oberon/</a> Oberon compiler</li><li>(*) <a href="https://github.com/franko/luajit-lang-toolkit" target="_blank" rel="noreferrer">https://github.com/franko/luajit-lang-toolkit</a> A Lua to LuaJIT bytecode compiler/toolkit to enable different language frontends and different compilation backends.</li><li><a href="https://github.com/rochus-keller/LjTools" target="_blank" rel="noreferrer">https://github.com/rochus-keller/LjTools</a> LuaJIT tools, a Qt5 GUI parser, browser, assembler and test VM for LuaJIT 2.0 bytecode</li></ul><h3 id="vm-forks" tabindex="-1">VM forks <a class="header-anchor" href="#vm-forks" aria-label="Permalink to &quot;VM forks&quot;">​</a></h3><ul><li><a href="https://github.com/mingodad/ljs" target="_blank" rel="noreferrer">https://github.com/mingodad/ljs</a> <em>ljs</em> JS-like syntax with modified VMs for PUC Lua, LuaJIT and RaptorJIT</li><li><a href="https://github.com/PlutoLang/Pluto" target="_blank" rel="noreferrer">https://github.com/PlutoLang/Pluto</a> A superset of Lua 5.4 — with unique features, optimizations, and improvements.</li></ul><h3 id="tier-1" tabindex="-1">Tier 1 <a class="header-anchor" href="#tier-1" aria-label="Permalink to &quot;Tier 1&quot;">​</a></h3><p>より良い呼称はありませんが、これらのプロジェクトはよく知られており、または既存の言語をコンパイルしています。</p><ul><li><a href="http://yuescript.org/" target="_blank" rel="noreferrer">http://yuescript.org/</a> Yuescript, an extended and actively developed form of Moonscript.</li><li><a href="http://moonscript.org/" target="_blank" rel="noreferrer">http://moonscript.org/</a> Moonscript, indentation based syntax, based on the ideas of Coffeescript.</li><li><a href="http://haxe.org" target="_blank" rel="noreferrer">http://haxe.org</a> Haxe, strongly typed language with both functional and object-oriented features, that has multiple backends</li><li><a href="https://github.com/yanghuan/CSharp.lua" target="_blank" rel="noreferrer">https://github.com/yanghuan/CSharp.lua</a> C# transpiler</li></ul><h3 id="go-go-like" tabindex="-1">Go/Go-like <a class="header-anchor" href="#go-go-like" aria-label="Permalink to &quot;Go/Go-like&quot;">​</a></h3><ul><li>(*) <a href="https://github.com/gijit/gi" target="_blank" rel="noreferrer">https://github.com/gijit/gi</a> translates Go into Lua. It targets LuaJIT for 64-bit integer support.</li><li>(*) <a href="https://github.com/theFox6/LuaVenusCompiler" target="_blank" rel="noreferrer">https://github.com/theFox6/LuaVenusCompiler</a> Transpiler for <a href="https://github.com/retroverse/venus" target="_blank" rel="noreferrer">Venus</a>, a Go-like language</li><li><a href="https://github.com/erde-lang/erde" target="_blank" rel="noreferrer">https://github.com/erde-lang/erde</a> Transpiler with Go-like syntax favoring symbols over words</li></ul><h3 id="typed-lua" tabindex="-1">Typed Lua <a class="header-anchor" href="#typed-lua" aria-label="Permalink to &quot;Typed Lua&quot;">​</a></h3><ul><li>(^) <a href="https://github.com/devcat-studio/kailua" target="_blank" rel="noreferrer">https://github.com/devcat-studio/kailua</a> KaiLua</li><li><a href="https://github.com/pallene-lang/pallene" target="_blank" rel="noreferrer">https://github.com/pallene-lang/pallene</a> Pallene, friendly fork of Titan</li><li>(*) <a href="https://github.com/titan-lang/titan-v0" target="_blank" rel="noreferrer">https://github.com/titan-lang/titan-v0</a> Titan</li><li>(*) <a href="https://github.com/ggVGc/Tua" target="_blank" rel="noreferrer">https://github.com/ggVGc/Tua</a> Tua</li><li><a href="https://github.com/teal-language/tl" target="_blank" rel="noreferrer">https://github.com/teal-language/tl</a> Teal</li><li><a href="https://github.com/CapsAdmin/NattLua" target="_blank" rel="noreferrer">https://github.com/CapsAdmin/NattLua</a> NattLua</li></ul><h3 id="binary-compiled-lua-like" tabindex="-1">Binary compiled Lua-like <a class="header-anchor" href="#binary-compiled-lua-like" aria-label="Permalink to &quot;Binary compiled Lua-like&quot;">​</a></h3><ul><li><a href="https://github.com/dibyendumajumdar/ravi" target="_blank" rel="noreferrer">https://github.com/dibyendumajumdar/ravi</a> and <a href="http://ravilang.github.io/" target="_blank" rel="noreferrer">http://ravilang.github.io/</a> Ravi</li><li><a href="http://terralang.org/" target="_blank" rel="noreferrer">http://terralang.org/</a> Terra</li><li><a href="https://github.com/edubart/nelua-lang" target="_blank" rel="noreferrer">https://github.com/edubart/nelua-lang</a> Nelua, Natively Extensible Lua</li></ul><h3 id="strongly-typed" tabindex="-1">Strongly typed <a class="header-anchor" href="#strongly-typed" aria-label="Permalink to &quot;Strongly typed&quot;">​</a></h3><ul><li><a href="https://github.com/rochus-keller/Oberon/" target="_blank" rel="noreferrer">https://github.com/rochus-keller/Oberon/</a> Oberon</li><li><a href="https://github.com/wu-lang/wu" target="_blank" rel="noreferrer">https://github.com/wu-lang/wu</a> Slightly Rusty with classes and traits</li></ul><h3 id="javascript" tabindex="-1">Javascript <a class="header-anchor" href="#javascript" aria-label="Permalink to &quot;Javascript&quot;">​</a></h3><ul><li>(*) <a href="https://github.com/PaulBernier/castl" target="_blank" rel="noreferrer">https://github.com/PaulBernier/castl</a> Javascript transpiler</li><li>(*) <a href="https://github.com/seanjensengrey/colony-js" target="_blank" rel="noreferrer">https://github.com/seanjensengrey/colony-js</a> Javascript transpiler</li><li>(*) <a href="https://github.com/saharNooby/lua-js-syntax" target="_blank" rel="noreferrer">https://github.com/saharNooby/lua-js-syntax</a> Javascript inspired syntax</li></ul><h3 id="typescript" tabindex="-1">TypeScript <a class="header-anchor" href="#typescript" aria-label="Permalink to &quot;TypeScript&quot;">​</a></h3><ul><li><a href="https://github.com/roblox-ts/roblox-ts" target="_blank" rel="noreferrer">https://github.com/roblox-ts/roblox-ts</a></li><li>(*) <a href="https://github.com/ASDAlexander77/TypeScriptLua" target="_blank" rel="noreferrer">https://github.com/ASDAlexander77/TypeScriptLua</a></li><li><a href="https://github.com/TypeScriptToLua/TypeScriptToLua" target="_blank" rel="noreferrer">https://github.com/TypeScriptToLua/TypeScriptToLua</a></li></ul><h3 id="functional" tabindex="-1">Functional <a class="header-anchor" href="#functional" aria-label="Permalink to &quot;Functional&quot;">​</a></h3><ul><li>(^) <a href="https://amulet.works" target="_blank" rel="noreferrer">https://amulet.works</a> An ML-like functional programming language that transpiles to lua</li><li><a href="https://github.com/kindl/Hypatia" target="_blank" rel="noreferrer">https://github.com/kindl/Hypatia</a> Hypatia, an ML-like language that transpiles to Lua</li><li>(*) <a href="https://github.com/ptol/oczor" target="_blank" rel="noreferrer">https://github.com/ptol/oczor</a> Haskell-like language that compiles to Lua, Javascript, Emacs lisp and Ruby</li><li>(*) <a href="https://github.com/iitalics/Lua-ML" target="_blank" rel="noreferrer">https://github.com/iitalics/Lua-ML</a> Basic ML language</li><li>(*) <a href="https://github.com/hengestone/pumpkin" target="_blank" rel="noreferrer">https://github.com/hengestone/pumpkin</a> ML-like language with an experimental Lua back-end</li><li><a href="https://github.com/minoki/LunarML" target="_blank" rel="noreferrer">https://github.com/minoki/LunarML</a> A Standard ML compiler that produces Lua</li><li><a href="https://github.com/Russoul/Idris2-Lua" target="_blank" rel="noreferrer">https://github.com/Russoul/Idris2-Lua</a> A Lua backend for Idris 2</li></ul><h3 id="lisp" tabindex="-1">Lisp <a class="header-anchor" href="#lisp" aria-label="Permalink to &quot;Lisp&quot;">​</a></h3><p>There are so many Lisp variants, they deserve their own category.</p><ul><li>(*) <a href="https://squiddev.github.io/urn/" target="_blank" rel="noreferrer">https://squiddev.github.io/urn/</a> Urn, Lisp dialect, extensive libraries</li><li><a href="https://github.com/bakpakin/Fennel" target="_blank" rel="noreferrer">https://github.com/bakpakin/Fennel</a> Lisp compiler and library</li><li>(*) <a href="https://github.com/meric/l2l" target="_blank" rel="noreferrer">https://github.com/meric/l2l</a> l2l (lisp) superset of Lua</li><li>(*) <a href="https://github.com/larme/hua" target="_blank" rel="noreferrer">https://github.com/larme/hua</a> Hua, Lisp dialect</li><li>(*) <a href="http://leafo.net/moonlisp/" target="_blank" rel="noreferrer">http://leafo.net/moonlisp/</a> Lisp implemented in Moonscript</li><li>(*) <a href="https://github.com/sctb/lumen" target="_blank" rel="noreferrer">https://github.com/sctb/lumen</a> Small Lisp</li><li>(*) <a href="https://github.com/bullno1/mLisp" target="_blank" rel="noreferrer">https://github.com/bullno1/mLisp</a></li><li>(*) <a href="https://github.com/WeirdConstructor/lal" target="_blank" rel="noreferrer">https://github.com/WeirdConstructor/lal</a> Scheme</li><li>(*) <a href="https://github.com/adamrk/scheme2luac" target="_blank" rel="noreferrer">https://github.com/adamrk/scheme2luac</a> Scheme</li><li><a href="https://github.com/LuxLang/lux" target="_blank" rel="noreferrer">https://github.com/LuxLang/lux</a> Statically typed, functional lisp with an ML-like module system</li></ul><h3 id="c" tabindex="-1">C <a class="header-anchor" href="#c" aria-label="Permalink to &quot;C&quot;">​</a></h3><ul><li>(*) <a href="https://github.com/davidgiven/clue" target="_blank" rel="noreferrer">https://github.com/davidgiven/clue</a></li></ul><h3 id="python" tabindex="-1">Python <a class="header-anchor" href="#python" aria-label="Permalink to &quot;Python&quot;">​</a></h3><ul><li>(*) <a href="https://github.com/MrVallentin/PyLua" target="_blank" rel="noreferrer">https://github.com/MrVallentin/PyLua</a></li><li>(*) <a href="https://github.com/NeonMercury/python-lua" target="_blank" rel="noreferrer">https://github.com/NeonMercury/python-lua</a></li><li><a href="https://github.com/MhadhbiXissam/pythonicLua" target="_blank" rel="noreferrer">https://github.com/MhadhbiXissam/pythonicLua</a></li></ul><h3 id="ruby" tabindex="-1">Ruby <a class="header-anchor" href="#ruby" aria-label="Permalink to &quot;Ruby&quot;">​</a></h3><ul><li>(*) <a href="https://github.com/Kilobyte22/Mlc" target="_blank" rel="noreferrer">https://github.com/Kilobyte22/Mlc</a></li></ul><h3 id="rust" tabindex="-1">Rust <a class="header-anchor" href="#rust" aria-label="Permalink to &quot;Rust&quot;">​</a></h3><ul><li><a href="https://github.com/ClueLang/Clue" target="_blank" rel="noreferrer">https://github.com/ClueLang/Clue</a> Clue, a language similar to Rust that compiles to any version of Lua</li></ul><h3 id="unique" tabindex="-1">Unique <a class="header-anchor" href="#unique" aria-label="Permalink to &quot;Unique&quot;">​</a></h3><ul><li>(*) <a href="https://github.com/presidentbeef/brat" target="_blank" rel="noreferrer">https://github.com/presidentbeef/brat</a> Brat, using <a href="https://github.com/moonjit/moonjit" target="_blank" rel="noreferrer">MoonJIT</a></li><li>(*) <a href="https://github.com/richardhundt/shine" target="_blank" rel="noreferrer">https://github.com/richardhundt/shine</a> Shine, using <a href="https://github.com/perl11/tvmjit" target="_blank" rel="noreferrer">TvmJit</a></li><li>(*) <a href="https://github.com/apotheon/vortex" target="_blank" rel="noreferrer">https://github.com/apotheon/vortex</a> Vortex</li><li>(*) <a href="https://github.com/tommo/yu" target="_blank" rel="noreferrer">https://github.com/tommo/yu</a> Yu</li><li>(*) <a href="https://github.com/Reuh/candran" target="_blank" rel="noreferrer">https://github.com/Reuh/candran</a> Candran</li></ul><h3 id="other" tabindex="-1">Other <a class="header-anchor" href="#other" aria-label="Permalink to &quot;Other&quot;">​</a></h3><ul><li>(*) <a href="https://github.com/marcoonroad/moonforth" target="_blank" rel="noreferrer">https://github.com/marcoonroad/moonforth</a> Forth to Lua transpiler</li><li><a href="https://github.com/tjdevries/vim9jit" target="_blank" rel="noreferrer">https://github.com/tjdevries/vim9jit</a> vim9script to Lua transpiler</li></ul>',42),o=[i];function h(n,u,s,g,p,c){return e(),a("div",null,o)}const f=t(l,[["render",h]]);export{m as __pageData,f as default};
